import React from "react";

function Card(props) {
  return (
    <div className="card ">
      <h2 className="name">{props.name}</h2>
      <img cl src={props.img} alt="avatar_img" />
      <p>{props.tel}</p>
      <p>{props.email}</p>
    </div>
  );
}
export default Card;
